import React from 'react';

const OutputComponent = ({ location }) => {
  const processedData = location.state.processedData;

  console.log('Processed Data:', processedData);

  return (
    <div>
      <label>Output Number 1: </label>
      <input type="text" value={processedData[0]} readOnly />
      <br />
      <label>Output Number 2: </label>
      <input type="text" value={processedData[1]} readOnly />
      <br />
      <label>Output Number 3 (Added 5): </label>
      <input type="text" value={processedData[2]} readOnly />
    </div>
  );
};

export default OutputComponent;
